import React from "react";

export default function Checking() {
  let details = [
    {
      name: "Pankaj Singh",
    },
    {
      name: "Yashi Gupta",
    },
    {
      name: "preet sharma",
    },
  ];

  return (
    <div>

        {details.map((x, i) => {
          return <li key={i}><a href="">{x.name}</a></li>;
        })}
 
    </div>
  );
}
